import React from "react";
import WeekText from "./WeekText.jsx";

const WeekDisplay = ({ currentWeek }) => {
  return (
    <div className="WeekDisplay">
      console.log(WeekText.getText());
      <p className="WeekDisplayText"> {currentWeek}</p>
    </div>
  );
};

export default WeekDisplay;
